import React, { Component } from "react";


class MyHistory extends Component {
    render() {
      return (
        <React.Fragment>
        <nav id="campus2">
                            
        <div class="campus">
        
           <h1>University Campus</h1><br/>
        
        </div>
        
         <div class="campus1">
        
        
                 <div>
                 <button onClick={this.StudentList}> StateBoard</button> 
                   <h3 id="state"></h3>
                 </div>
                  
                  
                  <h5>Matriculation</h5>
                 
                  <h5>CBSC</h5>
        
                  <h5>Primary</h5>
              
        
         </div>
        
        </nav>	</React.Fragment>
      );
    }
  
   
    StudentList() 
      {
     var stateBoard= document.getElementById("state");

        var studentData=[
          "diva","mano","bhar"
        ];
    stateBoard.innerText=studentData;
      }
      
      }
  
  export default MyHistory;
